def all_substring_of_size_n(s):
    if len(s) < 63:
        return []

    substrings = set()
    for i in range(len(s) - 62):
        substring = s[i:i+63]
        if len(set(substring)) == len(substring):
            substrings.add(substring)

    return list(substrings)
